    def get_properly_paired_reads_of_gene(self):
        """
            Determines the properly pared reads of bam file self.samfile and prints them if you remove the comment sign
            in line 124: #print(read). Additionally it prints the number of properly
            paired reads.

            :return: a list of the properly paired reads of the gene
            """
        properlyPairedReads = []
        count = 0
        for read in self.samfile:
            if read.is_proper_pair:
                properlyPairedReads.append(read)
                count += 1
                # remove comment sign for output on screen
                #print(read)
        print("\n{} Properly paired reads found.".format(count))
        return properlyPairedReads

    def get_gene_reads_with_indels(self):
        """
            Determines the gene reads with indels from bam file self.samfile and prints them if you remove the comment
            sign in line 142: #print(read). Additionally it prints the number of gene reads with indels.

            :return: a list of the gene reads with indels
            """
        geneReadsWithIndels = []
        count = 0
        for read in self.samfile:
            if not read.cigartuples is None and (read.cigartuples[0][0] == 1 or read.cigartuples[0][0] == 2):   # insertion = 1, deletion = 2
                geneReadsWithIndels.append(read)
                count += 1
                # remove comment sign for output on screen
                #print(read)
        print("\n{} gene reads with indels found.".format(count))
        return geneReadsWithIndels

    def calculate_total_average_coverage(self):
        """
            Calculates the total average coverage of the bedtool file self.bedtoolfile using the genome_coverage method
            from pybedtools and prints it.
            """
        self.coverageValues = self.bedtoolfile.genome_coverage(bg=True)
        count = 0
        sumValues = 0
        for line in self.coverageValues:
            count += 1
            sumValues += int(line[3])
        print("\ntotal average coverage:")
        print(float(sumValues)/float(count))

