    def get_number_mapped_reads(self):
        """
            Determines the number of mapped reads in the bam file self.samfile and prints it.
            """
        count = 0
        for read in self.samfile:
            if not read.is_unmapped:
                count += 1
        print("\nnumber of mapped reads: ")
        print(count)

